import React, { useState } from "react";
import "./Blog.css";

const TabsGrid = () => {
  const [activeTab, setActiveTab] = useState(1);

  const tabsData = [
    {
      tabName: "Latest",
      content: [
        [
          {
            img: "/assets/studio.jpg",
            title: "Product, Latest 7/8/25",
            desc: "Product Spotlight: Weekly Order Reports, Seller Hub Home, and Improvements to Order & Shipment Search.",
            link: "#",
          },
          {
            img: "/assets/tread.png",
            title: "Banana",
            desc: "Yellow bananas.",
            link: "#",
          },
          {
            img: "/assets/what.png",
            title: "Cherry",
            desc: "Sweet cherries.",
            link: "#",
          },
        ],
        [
          {
            img: "/images/img4.jpg",
            title: "Date",
            desc: "Delicious dates.",
            link: "#",
          },
          {
            img: "/images/img5.jpg",
            title: "Elderberry",
            desc: "Healthy elderberries.",
            link: "#",
          },
          {
            img: "/images/img6.jpg",
            title: "Fig",
            desc: "Juicy figs.",
            link: "#",
          },
        ],
      ],
    },
    {
      tabName: "Community",
      content: [
        [
          {
            img: "/images/img16.jpg",
            title: "Rose",
            desc: "Red roses.",
            link: "#",
          },
          {
            img: "/images/img17.jpg",
            title: "Tulip",
            desc: "Bright tulips.",
            link: "#",
          },
          {
            img: "/images/img18.jpg",
            title: "Sunflower",
            desc: "Sunny sunflowers.",
            link: "#",
          },
        ],
        [
          {
            img: "/images/img19.jpg",
            title: "Daisy",
            desc: "White daisies.",
            link: "#",
          },
          {
            img: "/images/img20.jpg",
            title: "Lily",
            desc: "Elegant lilies.",
            link: "#",
          },
          {
            img: "/images/img21.jpg",
            title: "Orchid",
            desc: "Beautiful orchids.",
            link: "#",
          },
        ],
      ],
    },
    {
      tabName: "Product",
      content: [
        [
          { img: "/images/img31.jpg", title: "Car", desc: "Sports car.", link: "#" },
          { img: "/images/img32.jpg", title: "Bike", desc: "Mountain bike.", link: "#" },
          { img: "/images/img33.jpg", title: "Bus", desc: "City bus.", link: "#" },
        ],
        [
          { img: "/images/img34.jpg", title: "Train", desc: "High-speed train.", link: "#" },
          { img: "/images/img35.jpg", title: "Plane", desc: "Airplane in sky.", link: "#" },
          { img: "/images/img36.jpg", title: "Boat", desc: "Sailing boat.", link: "#" },
        ],
      ],
    },
    {
      tabName: "Trust And Safety",
      content: [
        [
          { img: "/images/img46.jpg", title: "Laptop", desc: "High performance laptop.", link: "#" },
          { img: "/images/img47.jpg", title: "Tablet", desc: "Portable tablet.", link: "#" },
          { img: "/images/img48.jpg", title: "Smartphone", desc: "Latest smartphone.", link: "#" },
        ],
        [
          { img: "/images/img49.jpg", title: "Camera", desc: "DSLR camera.", link: "#" },
          { img: "/images/img50.jpg", title: "Headphones", desc: "Noise-cancelling headphones.", link: "#" },
          { img: "/images/img51.jpg", title: "Smartwatch", desc: "Fitness smartwatch.", link: "#" },
        ],
      ],
    },
    {
      tabName: "And WhatNew",
      content: [
        [
          { img: "/images/img61.jpg", title: "Football", desc: "Official size football.", link: "#" },
          { img: "/images/img62.jpg", title: "Basketball", desc: "Indoor/outdoor basketball.", link: "#" },
          { img: "/images/img63.jpg", title: "Tennis Racket", desc: "Professional racket.", link: "#" },
        ],
        [
          { img: "/images/img64.jpg", title: "Golf Club", desc: "Premium golf club.", link: "#" },
          { img: "/images/img65.jpg", title: "Hockey Stick", desc: "Durable hockey stick.", link: "#" },
          { img: "/images/img66.jpg", title: "Baseball Bat", desc: "Wooden baseball bat.", link: "#" },
        ],
      ],
    },
  ];

  return (
    <div className="tabs-container">
      {/* Tabs Navigation */}
      <div className="tabs-nav">
        {tabsData.map((tab, index) => (
          <button
            key={index}
            className={`tab-button ${activeTab === index + 1 ? "active" : ""}`}
            onClick={() => setActiveTab(index + 1)}
          >
            {tab.tabName}
          </button>
        ))}
      </div>

      {/* Tabs Content */}
      <div className="tabs-content">
        {tabsData.map((tab, index) => (
          <div key={index} style={{ display: activeTab === index + 1 ? "block" : "none" }}>
            <div className="grid-container">
              {tab.content.flat().map((item, itemIndex) => (
                <div key={itemIndex} className="grid-item">
                  <a href={item.link} className="item-link">
                    <div className="item-image-wrapper">
                      <img src={item.img} alt={item.title} className="item-image" />
                    </div>
                    <div className="item-content">
                      <h3 className="item-title">{item.title}</h3>
                      <p className="item-description">{item.desc}</p>
                    </div>
                  </a>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TabsGrid;
